    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    dataset is a survey of the FY12 St Johns River Water Management LiDAR Survey, project
    area in north-central Florida and encompasses 800 square miles. The LiDAR point
    cloud was flown at a nominal post spacing of 1.0 meters for unobscured areas. The
    LiDAR data and derivative products produced are in compliance with the U.S. Geological
    Survey National Geospatial Program Guidelines and Base Specifications, Version 13-ILMF
    2010. The flight lines were acquired by Digital Aerial Solutions, LLC. between April
    02, 2012 and April 11, 2012. Derivative products from the aerial acquisition include:
    Raw point cloud data in LAS v1.2, classified point cloud data in LAS v1.2, bare
    earth surface tiles (raster DEM ESRI float GRID format), bare earth surface DEMs
    mosaic (raster DEM MrSID format), control points, project report, and FGDC compliant
    XML metadata.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
